const types = [
    {
        name: "light rain",

        url: "../static/svg/rain.js",
        color: "#C5C5C5",
        color2: "#858383",
    },
    {
        name: "scattered clouds",
        url: "../static/svg/clouds.svg",
        color: "#C5C5C5",
        color2: "#858383",
    },
    {
        name: "clear sky",
        url: "../static/svg/clear.svg",
        color: "#3991F3",
        color2: "#66BEFE",
    },
    {
        name: "few clouds",
        url: "../static/svg/clouds.svg",
        color: "#C5C5C5",
        color2: "#858383",
    },
    {
        name: "heavy intensity rain",
        url: "../static/svg/rain.js",
        color: "#202020",
        color2: "#8D8D8D",
    },
    {
        name: "  very heavy rain",
        url: "../static/svg/rain",
        color: "#202020",
        color2: "#8D8D8D",
    },
];
export default function ConvertSkies(sky, temp, day) {
    const skyinfo = types.find((item) => {
        if (item.name === sky) return item;
    });
    console.log(skyinfo);
    if (!skyinfo) {
        return {
            name: "not found",
            url: "../static/svg/rain",
            color: "#C5C5C5",
            color2: "#858383",
        };
    }

    return skyinfo;
}
